var UINestable=function(){
	var t=function(t){
		var e=t.length?t:$(t.target),
		a=e.data("output");
		dt = window.JSON.stringify(e.nestable("serialize"));

	  	$.ajax({
			url: site_url+'admin/doctors-order',
			type: 'POST',
			dataType:"JSON",                 
			data: dt,
			contentType: 'application/json',
			success: function(result){
			}
		});
	};
		return{
			init:function(){
				
				$("#nestable_list_3").nestable({group:1}).on("change",t),
				t($("#nestable_list_3").data("output",$("#nestable_list_3_output"))),
				$("#nestable_list_menu").on("click",function(t){
					var e=$(t.target),a=e.data("action");
					"expand-all"===a&&$(".dd").nestable("expandAll"),
					"collapse-all"===a&&$(".dd").nestable("collapseAll")
				}),
				$("#nestable_list_3").nestable()
			}
		}
	}();
	jQuery(document).ready(function(){
		UINestable.init()
	});